import React from 'react';
import logo from './logo.svg';

// import BrowserRouter, Route, and Link components
import { BrowserRouter, Route, Link } from 'react-router-dom';

// import components
import Preloader from './Preloader.js';

// import css files
import './style.css';
import './table.css';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header></Header>
        <Home></Home>
        <About></About>
        {/* <Projects></Projects>*/ }
        <Contact></Contact>
        <Footer></Footer>
        <PhotoswipeBG></PhotoswipeBG>
      </div>
    </BrowserRouter>
  );
}

export default App;
